import React, { useState } from 'react';
import { render } from '@testing-library/react';
import './App.css';
import BST from './bst';

function App() {
  const [showBST, setShowBST] = useState(false);

  const handleButtonClick = () => {
    setShowBST(true);
  };

  return (
    <div className="App">
      <button onClick={handleButtonClick}>BST</button>
      {showBST && <BST />}
    </div>
  );
}

export default App;
